"CEuTEaRJNVO";}i:67;a:1:{s:12:"created_time";i:1599241364;}i:68;a:1:{s:7:"caption";s:1047:"Grey heron over the pond.

Grey herons are unmistakeable: tall, with long legs, a long beak and grey, black and white feathering. They can stand with their neck stretched out, looking for food, or hunched down with their neck bent over their chest.

They eat lots of fish, but also small birds such as ducklings, small mammals like voles and amphibians. 

After harvesting, grey herons can sometimes be seen in fields, looking for rodents.

Photo taken from my floating blind.

Grey heron facts :

- Latin name : Ardea cinerea
- Lenght : 90 - 96 cm
- Weight : 1,5 - 2 kg
- Wingspan : 175 - 195 cm
- Lifespan : 5 - 7 years

